    "Student username/email field is required and can not be empty. Kindly fill in username/email and then press \"Add to Exception List\" button.": "\u0421\u0443\u0440\u0430\u043b\u0446\u0430\u0433\u0447\u0438\u0439\u043d \u0425\u044d\u0440\u044d\u0433\u043b\u044d\u0433\u0447\u0438\u0439\u043d \u043d\u044d\u0440/\u0438\u043c\u044d\u0439\u043b \u0442\u0430\u043b\u0431\u0430\u0440\u0442 \u0443\u0442\u0433\u0430 \u043e\u0440\u0443\u0443\u043b\u0430\u0445 \u0448\u0430\u0430\u0440\u0434\u043b\u0430\u0433\u0430\u0442\u0430\u0439 \u0431\u0430 \u0445\u043e\u043e\u0441\u043e\u043d \u0431\u0430\u0439\u0436 \u0431\u043e\u043b\u043e\u0445\u0433\u04af\u0439. \u0425\u044d\u0440\u044d\u0433\u043b\u044d\u0433\u0447\u0438\u0439\u043d \u043d\u044d\u0440/\u0438\u043c\u044d\u0439\u043b \u0445\u0430\u044f\u0433\u0438\u0439\u0433 \u043e\u0440\u0443\u0443\u043b\u0430\u0430\u0434 \"\u0425\u0430\u0441\u0430\u043b\u0442\u044b\u043d \u0436\u0430\u0433\u0441\u0430\u0430\u043b\u0442\u0430\u043d\u0434 \u043d\u044d\u043c\u044d\u0445\" \u0442\u043e\u0432\u0447\u0438\u0439\u0433 \u0434\u0430\u0440\u043d\u0430 \u0443\u0443.",
    "Student username/email field is required and can not be empty. Kindly fill in username/email and then press \"Invalidate Certificate\" button.": "\u0421\u0443\u0440\u0430\u043b\u0446\u0430\u0433\u0447\u0438\u0439\u043d \u0445\u044d\u0440\u044d\u0433\u043b\u044d\u0433\u0447\u0438\u0439\u043d \u043d\u044d\u0440/\u0438\u043c\u044d\u0439\u043b \u0442\u0430\u043b\u0431\u0430\u0440\u0442 \u0443\u0442\u0433\u0430 \u043e\u0440\u0443\u0443\u043b\u0430\u0445 \u0448\u0430\u0430\u0440\u0434\u043b\u0430\u0433\u0430\u0442\u0430\u0439, \u0445\u043e\u043e\u0441\u043e\u043d \u0431\u0430\u0439\u0436 \u0431\u043e\u043b\u043e\u0445\u0433\u04af\u0439. \u0425\u044d\u0440\u044d\u0433\u043b\u044d\u0433\u0447\u0438\u0439\u043d \u043d\u044d\u0440/\u0438\u043c\u044d\u0439\u043b \u043e\u0440\u0443\u0443\u043b\u0430\u0430\u0434 \u0434\u0430\u0440\u0430\u0430 \u043d\u044c  \"\u0413\u044d\u0440\u0447\u0438\u043b\u0433\u044d\u044d\u0433 \u0445\u04af\u0447\u0438\u043d\u0433\u04af\u0439 \u0431\u043e\u043b\u0433\u043e\u0445\" \u0442\u043e\u0432\u0447\u0438\u0439\u0433 \u0434\u0430\u0440\u043d\u0430 \u0443\u0443.",
    "Studio's having trouble saving your work": "\u0425\u0430\u0434\u0433\u0430\u043b\u0430\u0445 \u044f\u0432\u0446\u0430\u0434 \u0430\u0441\u0443\u0443\u0434\u0430\u043b \u04af\u04af\u0441\u043b\u044d\u044d. ",
    "Submission aborted! Sorry, your browser does not support file uploads. If you can, please use Chrome or Safari which have been verified to support file uploads.": "\u041c\u044d\u0434\u04af\u04af\u043b\u044d\u0433 \u0446\u0443\u0446\u043b\u0430\u0433\u0434\u043b\u0430\u0430. \u0423\u0443\u0447\u043b\u0430\u0430\u0440\u0430\u0439, \u0442\u0430\u043d\u044b \u0445\u044d\u0440\u044d\u0433\u043b\u044d\u0436 \u0431\u0430\u0439\u0433\u0430\u0430 \u0445\u04e9\u0442\u04e9\u0447 \u043d\u044c \u0444\u0430\u0439\u043b \u0431\u0430\u0439\u0440\u0448\u0443\u0443\u043b\u0430\u0445\u044b\u0433 \u0434\u044d\u043c\u0436\u0438\u0445\u0433\u04af\u0439 \u0431\u0430\u0439\u043d\u0430. \u0425\u044d\u0440\u0432\u044d\u044d \u0431\u043e\u043b\u043e\u043c\u0436\u0442\u043e\u0439 \u0431\u043e\u043b \u0444\u0430\u0439\u043b \u0431\u0430\u0439\u0440\u0448\u0443\u0443\u043b\u0430\u0445\u044b\u0433 \u0434\u044d\u043c\u0436\u0434\u044d\u0433 \u043d\u044c \u0431\u0430\u0442\u0430\u043b\u0433\u0430\u0430\u0436\u0441\u0430\u043d Chrome \u044d\u0441\u0432\u044d\u043b Safari \u0445\u044d\u0440\u044d\u0433\u043b\u044d\u044d\u0440\u044d\u0439.",
    "Submit": "\u0418\u043b\u0433\u044d\u044d\u0445",
    "Submitted": "\u0418\u043b\u0433\u044d\u044d\u0433\u0434\u0441\u044d\u043d",
    "Success": "\u0410\u043c\u0436\u0438\u043b\u0442\u0442\u0430\u0439",
    "Support education research by providing additional information": "\u0411\u043e\u043b\u043e\u0432\u0441\u0440\u043e\u043b\u044b\u043d \u0441\u0443\u0434\u0430\u043b\u0433\u0430\u0430\u0433 \u0434\u044d\u043c\u0436\u0438\u0436 \u043d\u044d\u043c\u044d\u043b\u0442 \u043c\u044d\u0434\u044d\u044d\u043b\u044d\u043b \u0431\u04e9\u0433\u043b\u04e9\u0445",
    "Table": "\u0425\u04af\u0441\u043d\u044d\u0433\u0442",
    "Table properties": "\u0425\u04af\u0441\u043d\u044d\u0433\u0442\u0438\u0439\u043d \u0448\u0438\u043d\u0436 \u0447\u0430\u043d\u0430\u0440\u0443\u0443\u0434",
    "Take a photo of your ID": "\u04e8\u04e9\u0440\u0438\u0439\u043d \u0431\u04af\u0440\u0442\u0433\u044d\u043b\u0438\u0439\u043d \u0437\u0443\u0440\u0433\u0430\u0430 \u0434\u0430\u0440\u0430\u0445",
    "Target": "\u0411\u0430\u0439",
